import React from 'react';

const About = () => {
  return (
    <section id="about">
      <h2>Про Нас</h2>
      <p>Наша команда - це колектив професіоналів, що об'єднується любов'ю до звуку. Ми прагнемо створювати неповторні аудіоісторії, які залишаться в серцях слухачів.</p>
    </section>
  );
};

export default About;
